        "description": "Step into Travis‚Äô backyard, Jackson, Wyoming. Far beyond the legendary Jackson Hole Mountain Resort‚Äôs boundaries, Travis searches for the perfect unridden terrain. With his hometown crew of riders, led by snowboarding great Bryan Iguchi, Travis finds a bowl called ‚ÄúMars‚Äù deep in the Wyoming backcountry ‚Äì a zone that he has been trying to reach for 15 years. \n\nThe quest to find ‚ÄúMars‚Äù delivers a backcountry kicker and a summit of the continental divide ‚Äì showcasing Travis‚Äô riding and setting the bar for his next mission: Japan. \n\nTuesday, October 25 - Ep. 3 - Japan: Peaks, Pillows & Pow \nTuesday, November 1 - Ep. 4 - Alaska: The Reciprocal Loop \n\nWhere to buy \"The Fourth Phase:\" \nThe film is now available for purchase here:http://radi.al/TheFourthPhase. \n\nAbout the series: \nGoPro presents a four-part series - 'GoPro Perspectives: The Fourth Phase with Travis Rice' - which lends an intimate view of what it's like to be Travis Rice, as he drops in on some of the world's biggest lines during the filming of this multi-year production. \n  \nTap into Travis' mindset, through the perspective of his helmet-mounted GoPro, to understand the skill and calculation essential to getting the shot and staying safe in the backcountry. \n  \nAt its core, this series highlights some thrilling action from \"The Fourth Phase,\" but also the deep bonds between Travis and his friends Eric Jackson, Mark Landvik, Bryan Iguchi, Victor de Le Rue, and more. \n  \nEach episode begins with a raw, personal and intimate moment from the mountain, that could only be captured with a GoPro camera. GoPro‚Äôs entertainment team searched through over two-years of the best GoPro content that was collected during this multi-year project with Red Bull Media House, to bring you this incredible story. \n\nShot 100% on the HERO4¬Æ camera from \u202ahttp://GoPro.com.\n\nGet stoked and subscribe: http://goo.gl/HgVXpQ\n\nTo license clips from this video go to https://licensing.gopro.com \n\nMusic\n\nWove \"Inside the Storm\"\nLink to Buy: goo.gl/2AkK7t\n\nSadistik- \"Exit Theme\"\nLink to iTunes: goo.gl/HcZc1i\n\nMagic Sword - \"Legend of the Keeper\"\nLink to buy: http://tndr.lv/2wf9ADN\n\nFor more from GoPro, follow us:\nFacebook: https://www.facebook.com/gopro\nTwitter: https://twitter.com/gopro\nInstagram: https://instagram.com/gopro\nTumblr: http://gopro.tumblr.com/\nPinterest: http://www.pinterest.com/gopro   \nVine: https://goo.gl/m3nQz7",
