        "title": "Nikola Tesla Was SMARTER Than Albert Einstein, This Is Why",
        "description": "Nikola Tesla, Nikola Tesla 369 & Nikola Tesla Documentary\n\n\nüîî Subscribe now with all notifications on for more content about Nikola Tesla\n\nTesla could speak 8 languages, while Einstein could only speak 3 which is a common thing these days, you may easily find people who can speak 3 languages. But Tesla also had an eidetic memory and could memorize entire books after reading them once, while Einstein had to study hard to remember facts for tests at school. Tesla had an IQ of 187, which is considered ‚Äúgifted‚Äù by psychologists‚Äô standards . Einstein, by comparison, had an IQ of 160, which is considered \"genius\" but not nearly as high as Tesla‚Äôs.  The two great minds were friends and colleagues at the beginning of their careersbut the relationship turned sour when they disagreed over whether or not light has mass. Tesla believed it did , while Einstein held that it didn‚Äôt . They continued to argue over this for years, until one day Tesla finally decided to settle it once and for all: he challenged Einstein to a game of chess! If Einstein won, Tesla would have to come around to his way of thinking about light; if Tesla won‚Ä¶ well‚Ä¶ we‚Äôll get to that later.\nEinstein accepted the challenge, and they began playing in a coffee shop on New York City‚Äôs Lexington Avenue in front of witnesses who had gathered around to watch history being made. After just five moves by each player , Einstein realized he didn‚Äôt stand a chance against his friend‚Äôs superior strategy and conceded defeat.\n\nüì∫ Watch the entire video for more information!\n\n#nikolatesla #nikolatesla369 #nikolatesladocumentary\n_________________________________________________________________\n\nAbout Neuro Sign\nüé• Videos about Nikola Tesla\nüé® Written, voiced and produced by Neuro Sign\nüîî Subscribe now for more Nikola Tesla videos\n\nWatch More from Neuro Sign\nüü¢ https://www.youtube.com/channel/UCKJnMSz4d9Nat71Gav1xTHg/\n_____________________________